) ENGINE=InnoDB DEFAULT CHARSET=utf8 AUTO_INCREMENT=1 ;

ALTER TABLE `bans` ADD `ban_by` INT( 11 ) unsigned NULL DEFAULT NULL AFTER `ban_type` ,
